using ForCodingChallenges.LeetCode;

namespace TestProject_LeetCode_TwoPointers
{
    public class TestsLeetCode_TwoPointers
    {
        private LeetCode_TwoPointers _leetCode_TwoPointers;

        [SetUp]
        public void Setup(  )
        {
            _leetCode_TwoPointers = new LeetCode_TwoPointers();
        }

        [TestCase("aaaaaa", "bbaaaa", ExpectedResult = false)]
        [TestCase("abc", "ahbgdc" , ExpectedResult = true)]
        [TestCase("abc", "acb", ExpectedResult = false)]
        [TestCase("abc", "", ExpectedResult = false)]
        [TestCase("axc", "ahbgdc", ExpectedResult = false)]
        [TestCase("ab", "baab", ExpectedResult = true)]
        [TestCase("", "ahbgdc", ExpectedResult = true)]
        [TestCase("b", "c", ExpectedResult = false)]
        [TestCase("b", "abc", ExpectedResult = true)]
        [TestCase("b", "ahbgdc", ExpectedResult = true)]
        [TestCase("bb", "ahbgdc", ExpectedResult = false)]
        [TestCase("", "", ExpectedResult = true)]
        [TestCase("leet", "leeet", ExpectedResult = true)]
  
        [TestCase("bcd", "", ExpectedResult = true)]
        [TestCase("leeeeetcode", "", ExpectedResult = true)]
        public bool Test_LeetCode_TwoPointers_IsSubsequence(string s, string t)
        {
            return  _leetCode_TwoPointers.IsSubsequence(s,t);
        }
    }
}